  { name: "Cactus Name 10", price: 9.99, category: "Filter category", img: Cactus },
  { name: "Cactus Name 11", price: 9.99, category: "Filter category", img: Cactus },
  { name: "Cactus Name 12", price: 9.99, category: "Filter category", img: Cactus },
]

function App() {
  return (
    <div className="app">
      <h1>CS1300 Cactus Shop</h1>
      <Shop list={ProductList} />
    </div>
  );
}

export default App;
